import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { FuelType, BodyType } from "./Models/Car";
import axios from "axios";

export default function CarAdd() {
  const navigate = useNavigate();

  const [car, setCar] = useState({
    brand: "",
    model: "",
    doorsNumber: 0,
    luggageCapacity: 0,
    engineCapacity: 0,
    fuelType: FuelType.Petrol,
    productionDate: "",
    carFuelConsumption: 0,
    bodyType: BodyType.Sedan
  });

  const handleChange = (
    e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>
  ) => {
    const { name, value } = e.target;

    setCar((prev) => ({
      ...prev,
      [name]:
        name === "doorsNumber" ||
        name === "luggageCapacity" ||
        name === "engineCapacity" ||
        name === "carFuelConsumption" ||
        name === "fuelType" ||
        name === "bodyType"
          ? Number(value)
          : value,
    }));
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();

    const carToSend = {
      ...car,
      doorsNumber: Number(car.doorsNumber),
      luggageCapacity: Number(car.luggageCapacity),
      engineCapacity: Number(car.engineCapacity),
      carFuelConsumption: Number(car.carFuelConsumption),
      fuelType: Number(car.fuelType),
      bodyType: Number(car.bodyType)
    };

    try {
      await axios.post("https://localhost:7135/api/Cars", carToSend);
      navigate("/");
    } catch (err) {
      console.error(err);
      alert("Error adding car");
    }
  };

  return (
    <form
      onSubmit={handleSubmit}
      style={{
        maxWidth: "400px",
        display: "flex",
        flexDirection: "column",
        gap: "15px",
        padding: "20px",
      }}
    >
      <div>
        <label>Brand:</label>
        <input
          type="text"
          name="brand"
          value={car.brand}
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Model:</label>
        <input
          type="text"
          name="model"
          value={car.model}
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Doors Number:</label>
        <input
          type="number"
          name="doorsNumber"
          value={car.doorsNumber}
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Luggage Capacity:</label>
        <input
          type="number"
          name="luggageCapacity"
          value={car.luggageCapacity}
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Engine Capacity:</label>
        <input
          type="number"
          name="engineCapacity"
          value={car.engineCapacity}
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Fuel Type:</label>
        <select name="fuelType" value={car.fuelType} onChange={handleChange}>
          {Object.entries(FuelType)
            .filter(([key, value]) => !isNaN(Number(value)))
            .map(([key, value]) => (
              <option key={value} value={value}>
                {key}
              </option>
            ))}
        </select>
      </div>

      <div>
        <label>Production Date:</label>
        <input
          type="date"
          name="productionDate"
          value={car.productionDate}
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Fuel Consumption:</label>
        <input
          type="number"
          name="carFuelConsumption"
          value={car.carFuelConsumption}
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Body Type:</label>
        <select name="bodyType" value={car.bodyType} onChange={handleChange}>
          {Object.entries(BodyType)
            .filter(([key, value]) => !isNaN(Number(value)))
            .map(([key, value]) => (
              <option key={value} value={value}>
                {key}
              </option>
            ))}
        </select>
      </div>

      <button
        type="submit"
        style={{
          padding: "10px",
          background: "black",
          color: "white",
          borderRadius: "6px",
          cursor: "pointer",
        }}
      >
        Add
      </button>
    </form>
  );
}
